import React from 'react';
import css from '@emotion/core';

const Title = styled.div`
  color: black;
  border-bottom: 2px;
  border-color: black;
`;
const FlavorText = styled.div`
  color: grey;
`;

function App() {
  return (
    <div>
      <Title>Bear Lake Honey</Title>
      <FlavorText>Bee Happy</FlavorText>
    </div>
  );
}

export default App;
